import React from "react";
import parse from "html-react-parser";
import PortfolioItem from "webapp/common/component/Portfolio/PortfolioItem";
import PortfolioFilter from "webapp/common/component/Portfolio/PortfolioFilter";
import LoadScript from "helpers/LoadScript";

const WorkList = ({ title, tagline, backfont, data, filter, categories, classes, dash, dashColor }) => {
  LoadScript("js/portfolio/portfolio-grid.js");

  return (
    <section id="portfolio" className={"pb-0 " + classes}>
      <div className="container-fluid remove-padding">
        <div className={"row " + (!filter ? "mt-80" : "")}>
          <div className="col-md-12">
            <div id="portfolio-gallery" className="cbp">
              {data
                .filter((v, i) => i < 8)
                .map((item, i) => (
                  <PortfolioItem
                    key={item.id}
                    title={item.title}
                    categories={item.categories}
                    image={item.image}
                  />
                ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WorkList;
